A block consists of 1 or more expressions wrapped in { and }. Values of the last expressions are treated as resulting values of the blocks. { foo(ctx, z) x + y + z
} If you want to save results of intermediate expressions for later use, you can define variables putting their names and = operators in front of the expressions. { x = 42 ...
