If expression It evaluates one of blocks depending on a value of an expression of a boolean type. It evaluates the first block if a given boolean value is true. Otherwise, it evaluates the second block. if x { ...
} else { ...
} If-type expression It evaluates one of blocks depending on the type of a given expression. The expression (foo()) needs to be bound to a variable (x) and, in each block, the variable is treated as its specified type. if x = foo() as number { ...
} else if string | none { ...
} else { ...
} If-list expression It deconstructs a list and evaluates one of blocks depending on if the list is empty or not. If a given list has 1 or more element, it evaluates the first block with a function which returns its first element (x) and rest of elements as a list (xs). If it has no element, it evaluates the second block. if [x, ...xs] = ... { ...
} else { ...
}

